import React from 'react';
import Image from 'react-bootstrap/Image'
import NoneImage from './images/antiantimage.png';
class DisplayAgg extends React.Component{
    constructor(props) {
        super(props);
    }
    render(){
        var mysum = 0;
        var i = 0;
        for(i = 0; i < 5; i++){
            if(this.props.list[i]!='None'){
                mysum = mysum+this.props.list[i].advantage
            }
        }
        return (
            <>
            Total Advantage: {mysum.toFixed(2)}<br/>
            {this.props.list.map(item => 
                <div>
                    <Image src={item.image} thumbnail style={{ width:'40%'}}/>
                </div>
            )}
            </>
        );
    }
}
export default DisplayAgg;
